CREATE TABLE `actuators` (
  `id` int(20) unsigned NOT NULL auto_increment,
  `net_id` int(20) unsigned default NULL,
  `actuator` varchar(32) default NULL,
  PRIMARY KEY  (`id`)
) TYPE=MyISAM;


CREATE TABLE `descriptions` (
  `parameter` varchar(32) NOT NULL default '',
  `description` varchar(64) NOT NULL default '',
  PRIMARY KEY  (`parameter`)
) TYPE=MyISAM;


CREATE TABLE `events` (
  `id` int(20) unsigned NOT NULL auto_increment,
  `net_id` int(20) unsigned default NULL,
  `added` datetime default NULL,
  `name` varchar(32) default NULL,
  `criteria` text,
  `detected` int(1) default '0',
  `node_id` int(20) unsigned default NULL,
  `date_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) TYPE=MyISAM;

CREATE TABLE `history` (
  `id` int(20) unsigned NOT NULL auto_increment,
  `net_id` int(20) unsigned default NULL,
  `node_id` int(20) unsigned default NULL,
  `date_time` datetime default NULL,
  `parameter` varchar(32) default NULL,
  `value` varchar(32) default NULL,
  PRIMARY KEY  (`id`)
) TYPE=MyISAM;


CREATE TABLE `maintenance` (
  `id` int(20) unsigned NOT NULL auto_increment,
  `net_id` int(20) unsigned default NULL,
  `type` int(10) unsigned default NULL,
  `value` text,
  `node_id` int(20) unsigned default NULL,
  `repeat` int(10) unsigned default NULL,
  `event_id` int(20) unsigned default NULL,
  `date_time` datetime default NULL,
  `executed` datetime default NULL,
  `done` int(1) unsigned default '0',
  PRIMARY KEY  (`id`)
) TYPE=MyISAM;

CREATE TABLE `networks` (
  `id` int(20) unsigned NOT NULL auto_increment,
  `name` varchar(32) default NULL,
  `description` varchar(128) default NULL,
  `type` varchar(12) default 'WSN',
  PRIMARY KEY  (`id`)
) TYPE=MyISAM;


CREATE TABLE `parameters` (
  `id` int(20) unsigned NOT NULL auto_increment,
  `net_id` int(20) unsigned default NULL,
  `parameter` varchar(32) default NULL,
  PRIMARY KEY  (`id`)
) TYPE=MyISAM;

